const AboutMe = () => {
  return (
    <section>
      <h2 className="title-font pink-text h2-tag">About Me</h2>
      <p className="white-text p-tag">
      I am a recent computer science graduate with a passion for software development. I have 
      gained hands on experience through various projects and internships and I am eager to 
      apply my skills to real world challenges.
      </p>
    </section>
  );
};
export default AboutMe;
